import {db} from '../middlewares/firebase'
import { useEffect, useState } from 'react';
import {collection,getDocs} from "firebase/firestore";


function Dbread(){
    const [data, setData] = useState([]);
    const dataCollection = collection(db,'new')
    useEffect(()=>{

      const getData = async ()=>{
        const data = await getDocs(dataCollection)
        console.log(data.docs.name)
      }

      getData()
    }, [])
}

export default Dbread
